import React from "react";
import Logout from "./logout";
import "./Header.css"
const Header = () => {
    return (
        <>
         <div  className="Head">
             <div className="userid">
                 <div>user Id:06pp125</div>
             </div>
             <div className="username">
             <img src="estate.png" alt="" className="img1" />
                 <div>User Name</div>
                 <img src="down.png" alt="" className="img1" onClick={Logout}></img>
                 <Logout/>
             </div>
             </div>
        </>
      );
    };
    export default Header;
